import { navData } from "../../constants/data"

const NavData = () => {
  return (
    <div className="flex text-center gap-7">
        {
            navData.map(item=>(
              <div className="">
                <img src={item.url} alt="shopping"/>
                <p>{item.text}</p>
              </div>
            ))
        }
    </div>
  )
}

export default NavData
